import axios from "axios";

API_KEY = "api_key=OmE4NDQ2ZDRiNDA4ZWYwMjAyZDViOWMxMjJlNzY2MzI3"

export default {
  // Gets all books
  getAllStocks: function() {
    return axios.get(`https://api-v2.intrinio.com/companies?`+API_KEY);
  },
  getFavorites: function(){
    return axios.get("/books/id");
  }
};
